sourcesContent:
import React, { useState, useEffect, useRef } from 'react';
import { BarChart, Bar, XAxis, YAxis, CartesianGrid, Tooltip, ResponsiveContainer, ReferenceLine, Cell } from 'recharts';

// (Alle Icons und Konstanten wie scales, itemDetails, scaleDetails, getAgeCategory und T-Wert-Funktionen bleiben unverändert)
const Trash2 = ({ className = "w-5 h-5" }) => ( <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round" className={className}><polyline points="3 6 5 6 21 6" /><path d="M19 6v14a2 2 0 0 1-2 2H7a2 2 0 0 1-2-2V6m3 0V4a2 2 0 0 1 2-2h4a2 2 0 0 1 2 2v2" /><line x1="10" y1="11" x2="10" y2="17" /><line x1="14" y1="11" x2="14" y2="17" /></svg>);

// ##################################################################
// ### SCL-90-R Logic and Data                                    ###
// ##################################################################

const scales = {
    'Somatisierung': [1, 4, 12, 27, 40, 42, 48, 49, 52, 53, 56, 58],
    'Zwanghaftigkeit': [3, 9, 10, 28, 38, 45, 46, 51, 55, 65],
    'Unsicherheit im Sozialkontakt': [6, 21, 34, 36, 37, 41, 61, 69, 73],
    'Depressivität': [5, 14, 15, 20, 22, 26, 29, 30, 31, 32, 54, 71, 79],
    'Ängstlichkeit': [2, 17, 23, 33, 39, 57, 72, 78, 80, 86],
    'Aggressivität/Feindseligkeit': [11, 24, 63, 67, 74, 81],
    'Phobische Angst': [13, 25, 47, 50, 70, 75, 82],
    'Paranoides Denken': [8, 18, 43, 68, 76, 83],
    'Psychotizismus': [7, 16, 35, 62, 77, 84, 85, 87, 88, 90],
};

const itemDetails = {
    1: 'Kopfschmerzen', 4: 'Ohnmachts- oder Schwindelgefühle', 12: 'Herz- und Brustschmerzen', 27: 'Kreuzschmerzen', 40: 'Übelkeit oder Magenverstimmung', 42: 'Muskelschmerzen', 48: 'Schwierigkeiten beim Atmen', 49: 'Hitzewallungen oder Kälteschauer', 52: 'Taubheit oder Kribbeln', 53: 'Kloßgefühl im Hals', 56: 'Schwächegefühl in einzelnen Körperteilen', 58: 'Schweregefühl in Armen oder Beinen',
    3: 'Immer wieder auftauchende unangenehme Gedanken', 9: 'Gedächtnisschwierigkeiten', 10: 'Beunruhigung wegen Achtlosigkeit', 28: 'Gefühl, dass es schwerfällt, etwas anzufangen', 38: 'Notwendigkeit, alles sehr langsam zu tun', 45: 'Bedürfnis, etwas immer wieder zu überprüfen', 46: 'Schwierigkeiten, sich zu entscheiden', 51: 'Leere im Kopf', 55: 'Gefühl, sich Dinge wieder und wieder von der Seele reden zu müssen', 65: 'Ständige Beschäftigung mit Banalitäten',
    6: 'Gefühl, in sozialen Situationen unzulänglich oder ausgeliefert zu sein', 21: 'Starke Selbstkritik im Vergleich zu anderen', 34: 'Schüchternheit im Umgang mit dem anderen Geschlecht', 36: 'Gefühl, dass andere einen nicht verstehen', 37: 'Gefühl, dass Leute unfreundlich sind', 41: 'Verletzlichkeit in Gefühlsdingen', 61: 'Minderwertigkeitsgefühle gegenüber anderen', 69: 'Unbehagen, wenn man beobachtet wird', 73: 'Starke Befangenheit im Umgang mit anderen',
    5: 'Verminderung des Interesses an Sexualität', 14: 'Energielosigkeit oder Verlangsamung', 15: 'Gedanken, sich das Leben zu nehmen', 20: 'Neigung zum Weinen', 22: 'Befürchtung, ertappt zu werden', 26: 'Selbstvorwürfe', 29: 'Einsamkeitsgefühle', 30: 'Schwermut', 31: 'Gefühl, sich zu viele Sorgen zu machen', 32: 'Gefühl, sich für nichts zu interessieren', 54: 'Gefühl der Hoffnungslosigkeit', 71: 'Gefühl, dass alles sehr anstrengend ist', 79: 'Gefühl, wertlos zu sein',
    2: 'Nervosität oder inneres Zittern', 17: 'Zittern', 23: 'Plötzliches Erschrecken ohne Grund', 33: 'Furchtsamkeit', 39: 'Herzklopfen oder Herzrasen', 57: 'Gefühl, gespannt oder aufgeregt zu sein', 72: 'Schreck- oder Panikanfälle', 78: 'Starke Ruhelosigkeit', 80: 'Gefühl, dass etwas Schlimmes passieren wird', 86: 'Angst- oder Schreckvorstellungen',
    11: 'Leicht reizbar oder verärgert sein', 24: 'Gefühlsausbrüche, gegen die man machtlos ist', 63: 'Drang, jemanden zu schlagen/verletzen', 67: 'Drang, Dinge zu zerbrechen', 74: 'Neigung, in Auseinandersetzungen zu geraten', 81: 'Bedürfnis, laut zu schreien',
    13: 'Furcht auf offenen Plätzen oder auf der Straße', 25: 'Befürchtungen, wenn man alleine aus dem Haus geht', 47: 'Furcht vor Fahrten mit öffentlichen Verkehrsmitteln', 50: 'Notwendigkeit, Orte/Tätigkeiten aus Angst zu meiden', 70: 'Abneigung gegen Menschenmengen', 75: 'Nervosität, wenn man alleine gelassen wird', 82: 'Furcht, in der Öffentlichkeit in Ohnmacht zu fallen',
    8: 'Gefühl, dass andere an Schwierigkeiten schuld sind', 18: 'Gefühl, den meisten Leuten nicht trauen zu können', 43: 'Gefühl, dass andere einen beobachten oder über einen reden', 68: 'Ideen, die andere nicht teilen', 76: 'Gefühl mangelnder Anerkennung', 83: 'Gefühl, dass andere einen ausnutzen würden',
    7: 'Gefühl, jemand hätte Macht über die Gedanken', 16: 'Stimmen hören, die sonst niemand hört', 35: 'Idee, dass andere geheimste Gedanken wissen', 62: 'Auftauchen von Gedanken, die nicht die eigenen sind', 77: 'Einsamkeitsgefühle, selbst in Gesellschaft', 84: 'Unangenehme sexuelle Vorstellungen', 85: 'Gedanken, für Sünden bestraft zu werden', 87: 'Gedanken, dass mit dem Körper etwas nicht stimmt', 88: 'Eindruck, sich niemandem nahe fühlen zu können', 90: 'Gedanken, dass mit dem Verstand etwas nicht stimmt',
    19: 'Schlechter Appetit', 44: 'Einschlafschwierigkeiten', 59: 'Gedanken an den Tod und ans Sterben', 60: 'Drang, sich zu überessen', 64: 'Frühes Erwachen am Morgen', 66: 'Unruhiger oder gestörter Schlaf', 89: 'Schuldgefühlen',
};

const scaleDetails = {
    'Somatisierung': { items: 12, inhalt: "Erfasst körperliche Beschwerden, die nicht hinreichend somatisch erklärt werden können.", symptome: "Kreislaufprobleme, Magen-Darm-Beschwerden, Atemnot, Muskelschmerzen.", bedeutung: "Häufig bei somatoformen Störungen, aber auch bei Depressionen, Angststörungen und posttraumatischen Belastungsstörungen. Klinisch relevant ist insbesondere die psychosomatische Schnittstelle sowie die Einbettung der Symptome in das biopsychosoziale Modell. Differenzialdiagnostisch ist die Abgrenzung zu somatischen Erkrankungen zentral." },
    'Zwanghaftigkeit': { items: 10, inhalt: "Deckt ein Kontinuum von Konzentrations- und Entscheidungsproblemen bis hin zu schwerwiegenden Zwangsgedanken und -handlungen ab.", symptome: "Perfektionismus, wiederholtes Kontrollieren, Grübeln, ritualisiertes Verhalten.", bedeutung: "Hinweis auf Zwangsstörungen, aber auch auf eine überkontrollierte Persönlichkeit oder neurotische Anspannung. Besonders relevant ist die Unterscheidung zwischen pathologischen Zwängen und zwanghaften Persönlichkeitsmerkmalen. Auch bei Essstörungen, Autismus und Angststörungen können zwanghafte Elemente auftreten." },
    'Unsicherheit im Sozialkontakt': { items: 9, inhalt: "Erfasst subjektive Unsicherheiten im zwischenmenschlichen Bereich, soziale Ängste und Selbstabwertungen.", symptome: "Schüchternheit, Angst vor Ablehnung, Minderwertigkeitsgefühle.", bedeutung: "Typisch bei sozialer Phobie, ängstlich-vermeidender Persönlichkeitsstörung und depressiven Episoden. Auch bei Jugendlichen mit Mobbingerfahrungen oder sozialen Defiziten kann dieser Bereich besonders ausgeprägt sein. Therapeutisch relevant für Gruppentherapie und soziales Kompetenztraining." },
    'Depressivität': { items: 13, inhalt: "Reicht von gedrückter Stimmung, Interessenverlust bis hin zu suizidalen Gedanken.", symptome: "Traurigkeit, Hoffnungslosigkeit, Antriebsverlust, Schuldgefühle, Suizidgedanken.", bedeutung: "Diese Skala bildet die zentrale Dimension bei depressiven Störungen. Eine hohe Ausprägung ist auch bei Dysthymie, bipolarer Störung (depressive Phase) und postpartalen Depressionen zu beobachten. Suizidgedanken erfordern eine unmittelbare differenzierte Risikoabschätzung." },
    'Ängstlichkeit': { items: 10, inhalt: "Umfasst emotionale, kognitive und körperliche Aspekte der Angst.", symptome: "Nervosität, Herzrasen, Schweißausbrüche, Erwartungsangst.", bedeutung: "Zentral bei generalisierter Angststörung, Panikstörung sowie spezifischen Phobien. Komorbidität mit Depressionen ist häufig. Angst kann auch in Form von Reizdarm oder anderen somatoformen Beschwerden Ausdruck finden. Wichtig für die Differenzierung gegenüber körperlichen Erkrankungen wie Hyperthyreose oder kardialen Störungen." },
    'Aggressivität/Feindseligkeit': { items: 6, inhalt: "Misst Gereiztheit, Wutimpulse und destruktive Einstellungen gegenüber anderen.", symptome: "Gereiztheit, Wutanfälle, Groll, zynische Gedanken.", bedeutung: "Kann bei Impulskontrollstörungen, Persönlichkeitsstörungen (insb. Borderline), manische Episoden oder posttraumatische Reaktionen hinweisen. Erhöhte Werte sind auch bei Belastung, Substanzkonsum oder in forensischen Kontexten häufig. Beeinträchtigt oft das therapeutische Bündnis." },
    'Phobische Angst': { items: 7, inhalt: "Umfasst irrationale, stark eingeengte Ängste mit Vermeidungstendenz.", symptome: "Angst in Menschenmengen, Höhenangst, Platzangst, Angst vor öffentlichen Verkehrsmitteln.", bedeutung: "Typisch bei Agoraphobie, sozialer Phobie oder spezifischen Phobien. Diagnostisch abzugrenzen von Zwangsvermeidung oder realitätsbezogenen Ängsten bei PTBS. Relevanz für Expositionsbasierte Verfahren." },
    'Paranoides Denken': { items: 6, inhalt: "Misstrauen, Gedankenbeeinflussung, überwertige Ideen, Gefühl des Beobachtetwerdens.", symptome: "Misstrauen, Überzeugung, dass andere über einen reden oder Pläne schmieden, übermäßiges Gerechtigkeitsempfinden.", bedeutung: "Häufig bei paranoiden Persönlichkeitsstörungen und psychotischen Zuständen. Auch bei PTBS, Borderline-Störung und ausgeprägten Stressreaktionen möglich. Besonders wichtig in der Beziehungsdiagnostik, da Misstrauen den therapeutischen Prozess erheblich stören kann." },
    'Psychotizismus': { items: 10, inhalt: "Breites Spektrum zwischen sozialem Rückzug, exzentrischem Verhalten bis hin zu psychotischem Erleben.", symptome: "Soziale Isolation, Gefühl der Entfremdung, ungewöhnliche Wahrnehmungen oder Gedanken.", bedeutung: "Hohe Werte können auf schizotype Störungen, beginnende Psychosen oder schwere Belastungsreaktionen hinweisen. Auch dissoziative Phänomene und magisches Denken fallen in diesen Bereich. Wichtig zur Früherkennung psychotischer Entwicklungen und für differenzialdiagnostische Überlegungen." },
    'GSI': { inhalt: "Misst die durchschnittliche psychische Belastung über alle Items hinweg. Er ist der zentrale Gesamtwert zur Beurteilung des allgemeinen Schweregrads psychischer Symptomatik." },
    'PST': { inhalt: "Zeigt an, wie viele Symptome überhaupt angegeben wurden. Maß für die Symptomvielfalt." },
    'PSDI': { inhalt: "Misst die mittlere Intensität der angegebenen Symptome. Hilfreich zur Einschätzung subjektiver Leidensschwere." }
};

const getAgeCategory = (age) => {
    if (age >= 12 && age <= 14) return 1;
    if (age >= 15 && age <= 17) return 2;
    if (age >= 18 && age <= 29) return 3;
    if (age >= 30 && age <= 39) return 4;
    if (age >= 40 && age <= 49) return 5;
    if (age >= 50 && age <= 59) return 6;
    if (age >= 60 && age <= 69) return 7;
    if (age >= 70) return 8;
    return 3; // Default
};

// --- Vollständige T-Wert-Funktionen ---
// ------ SKALA 1: SOMATISIERUNG ------
